import React from 'react'

const Banner = () => {
  return (
    <div className=" w-full h-screen flex items-center justify-center banner">

      <img src='url(https://placekitten.com/1400)' alt='banner'/>
      <h1 className='f-bold'>Exploring the Cosmos with SpaceX Capsules: Your Launchpad to the Stars!</h1> 
    </div>
  )
}

export default Banner
